import React from 'react';

function DefenseVote(props) {
    return (
        <div>
            <button onClick={() => props.defenseVote('yes')} >Yes</button>
            <button onClick={() => props.defenseVote('no')} >No</button>
        </div>
    );
}

export default DefenseVote;
